    false,nt"url": null,nt"notes": "This annual narrative report for Edwin
    B. Forsythe National Wildlife Refuge- Barnegat Division outlines Refuge accomplishments
    during the 1986 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the master plan, management planning, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands,
    forests, haying, fire management, and pest control. The wildlife section of the
    report discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, wildlife propagation, animal control, and marking
    and bird banding. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, equipment replacement,
    and communication systems. Items of interest are provided at the end. Refuge brochures
    and field guides are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
